@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("www.deviantart.com") {

#top {margin-top:-40px}
#top-collect, #moremenu-h, #top h1, .left-sidebar, #depths, #see-also, .feedbutton, .frontbutton, .browse2-limits {display:none !important}
#prev-next-links {position:absolute; top:0px; left:600px}
#searchForm {position:absolute; top:-30px; left:20px; z-index:10}
#mcstatus {display:none}
#facetMenu-Browse  {display:none}

#facetMenu-Category:hover {left:-20px !important}
#facetMenu-Category {position:relative; left:-150px; padding-left:50px; width:0px !important}
#facetMenu-Category li {background-color:#CCD9C8}
.browse2-right {width:1210px !important; margin-left:-50px}
#browse2-description {position:relative; left:200px}
.sleekadbubble {display:none}
}
